#
# View "view_group_angsuran"
#

DROP VIEW IF EXISTS `view_group_angsuran`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `view_group_angsuran`
  AS
SELECT
  `a`.`angsuran_id`,
  `a`.`anggota_id`,
  `a`.`group_id`,
  `d`.`kode_group`,
  `b`.`nama_lengkap`,
  `a`.`jenis_pinjaman_id`,
  `c`.`jenis_pinjaman`,
  `a`.`periode`,
  SUBSTR(`a`.`periode`,4, 4) AS 'tahun',
  SUM(`a`.`jumlah_bayar`) AS 'jumlah_bayar',
  (SELECT SUM(`b`.`jumlah_pinjaman`) FROM `tbl_pinjaman` b WHERE `b`.`anggota_id` = `a`.`anggota_id` AND `b`.`jenis_pinjaman_id` = `a`.`jenis_pinjaman_id`) AS 'jumlah_pinjaman'
FROM
  (((`tbl_angsuran` a
    LEFT JOIN `tbl_anggota` b ON (`a`.`anggota_id` = `b`.`anggota_id`))
    LEFT JOIN `tbl_jenis_pinjaman` c ON (`a`.`jenis_pinjaman_id` = `c`.`jenis_pinjaman_id`))
    LEFT JOIN `tbl_group_angsuran` d ON (`a`.`group_id` = `d`.`angsuran_group_id`))
GROUP BY
  `a`.`angsuran_id`
ORDER BY `a`.`group_id`, `b`.`nama_lengkap`;

#
# View "view_sisa_piutang"
#

DROP VIEW IF EXISTS `view_sisa_piutang`;
CREATE ALGORITHM=UNDEFINED VIEW `view_sisa_piutang` AS SELECT
  `a`.`anggota_id`,
  `b`.`nama_lengkap`,
  `a`.`jenis_pinjaman_id`,
  `c`.`jenis_pinjaman`,
  `a`.`periode`,
  SUBSTR(`a`.`periode`,4, 4) AS 'tahun',
  SUM(`a`.`jumlah_pinjaman`) AS 'jumlah_pinjaman',
  IFNULL((SELECT SUM(`tbl_angsuran`.`jumlah_bayar`) FROM `tbl_angsuran` WHERE `tbl_angsuran`.`anggota_id` = `a`.`anggota_id` AND `tbl_angsuran`.`jenis_pinjaman_id` = `a`.`jenis_pinjaman_id`),, 0) AS 'jumlah_bayar',
  SUM(`a`.`jumlah_pinjaman`) - IFNULL((SELECT SUM(`tbl_angsuran`.`jumlah_bayar`) FROM `tbl_angsuran` WHERE `tbl_angsuran`.`anggota_id` = `a`.`anggota_id` AND `tbl_angsuran`.`jenis_pinjaman_id` = `a`.`jenis_pinjaman_id`),, 0) AS 'sisa_piutang'
FROM
  ((`tbl_pinjaman` a
    LEFT JOIN `tbl_anggota` b ON (`a`.`anggota_id` = `b`.`anggota_id`))
    LEFT JOIN `tbl_jenis_pinjaman` c ON (`a`.`jenis_pinjaman_id` = `c`.`jenis_pinjaman_id`))
GROUP BY
  `a`.`anggota_id`, `a`.`jenis_pinjaman_id`, SUBSTR(`a`.`periode`,4, 4) AND SUBSTR(`a`.`periode`,4, 4) = SUBSTR(`a`.`periode`,4, 4)
ORDER BY `b`.`nama_lengkap`;

#
# View "view_sisa_piutang2"
#

DROP VIEW IF EXISTS `view_sisa_piutang2`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `view_sisa_piutang2`
  AS
SELECT
  `a`.`pinjaman_id`,
  `a`.`anggota_id`,
  `b`.`nama_lengkap`,
  `a`.`jenis_pinjaman_id`,
  `c`.`jenis_pinjaman`,
  `a`.`periode`,
  `a`.`jumlah_pinjaman`,
  SUM(`d`.`jumlah_bayar`) AS 'sum(d.jumlah_bayar)'
FROM
  (((`tbl_pinjaman` a
    LEFT JOIN `tbl_anggota` b ON (`a`.`anggota_id` = `b`.`anggota_id`))
    LEFT JOIN `tbl_jenis_pinjaman` c ON (`a`.`jenis_pinjaman_id` = `c`.`jenis_pinjaman_id`))
    LEFT JOIN `tbl_angsuran` d ON (`a`.`pinjaman_id` = `d`.`pinjaman_id`))
GROUP BY
  `a`.`anggota_id`, `a`.`pinjaman_id`, `a`.`jenis_pinjaman_id`, SUBSTR(`a`.`periode`,4, 4) AND SUBSTR(`a`.`periode`,4, 4) = SUBSTR(`a`.`periode`,4, 4)
ORDER BY `a`.`pinjaman_id`;
